--
-- Triggers `footwear_models`
--
DELIMITER $$
CREATE TRIGGER `update_stock_to_zero` AFTER UPDATE ON `footwear_models` FOR EACH ROW BEGIN
    -- Check if stock_availability is updated to 'No'
    IF NEW.stock_available = 'No' THEN
        UPDATE footwear_stock
        SET stock = 0
        WHERE model_id = NEW.model_id;
    END IF;
END
$$
DELIMITER ;

